function loadLinearAliFoldSample(index) {
  if (index < LS_SAMPLES.length) {
    document.getElementById("seqInput").value = LAF_SAMPLES[index];
  } else {
    document.getElementById("seqInput").value = index;
  }
}

document.querySelectorAll(".em-value").forEach((item) => {
  item.addEventListener("click", (e) => {
    e.preventDefault();
    const btn = document.getElementById("energyModelDropdownSelector");
    const input = document.getElementById("energyModel");
    btn.textContent = e.target.textContent;
    input.value = e.target.getAttribute("data-value");
  });
});

// query selector for the mode dropdown
document.querySelectorAll(".mode-value").forEach((item) => {
  item.addEventListener("click", (e) => {
    e.preventDefault();
    const btn = document.getElementById("modeDropdownSelector");
    const input = document.getElementById("mode");
    btn.textContent = e.target.textContent;
    input.value = e.target.getAttribute("data-value");
  });
});

